    true,nt"url": null,nt"notes": "<p>AoA's Performance Outcomes Measures project
    (POMP) helps States and Area Agencies on Aging assess their own program performance,
    while assisting AoA to meet the accountability provisions of the Government Performance
    and Results Act (GPRA) and the Office of Management and Budget's (OMB) program assessment
    requirements.  Through annual performance reports, Federal agencies provide detailed
    information on their progress in meeting program performance objectives. Congress
    and OMB now use performance information to support budget decisions. Many state
    and local governments are requiring similar systems of accountability to document
    results and justify funding.  In order to gather information on the performance
    of its program, the Administration on Aging surveys the participants in its Older
    Americans Act programs. These national surveys provide a portrait of who receives
    these services and how they assess the quality of the services received.</p>n",nt"license_title":
